import React from 'react';
import './Content.css';

const Content = () => {
  return (
    <section className="content-section">
      <div className="content-container">
        <h3>SLAM FITNESS STUDIO</h3>
        
        <div className="content-text">
          <p className="lead">SLAM Fitness is not a gym; it is a way of life.</p>
          
          <p>
            Slam Fitness Studio is a premier destination for fitness enthusiasts who seek a results-driven, 
            holistic approach to health and wellness. Established in 2009, Slam Fitness redefined the 
            fitness industry in India with its innovative programs, cutting-edge facilities, and focus 
            on building a supportive fitness community.
          </p>
        </div>
      </div>
    </section>
  );
};

export default Content;
